import React from "react";
import "./Footer.css";
import { assets } from "../../assets/assets";


const Footer = () => {
  return (
    <div className="footer" id="footer">
      <div className="footer-content">
        <div className="footer-content-left">
          <img src={assets.logo} alt="" />
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime
            dolore repellendus harum esse velit excepturi beatae tenetur! Odit
            ut harum placeat sit reiciendis. Repellendus fuga veniam quaerat
            modi quis obcaecati?
          </p>
          <div className="footer-social-icon">
            <img src={assets.facebook_icon} alt="" />
            <img src={assets.twitter_icon_icon} alt="" />
            <img src={assets.linkedin_icon} alt="" />
          </div>
        </div>
        <div className="footer-content-center"></div>
        <div className="footer-content-Right"></div>
      </div>
    </div>
  );
};

export default Footer;
